import React, { Component, lazy, Suspense } from 'react';
import { Link } from 'react-router-dom';
import { Bar, Doughnut, Line, Pie, Polar, Radar } from 'react-chartjs-2';
import { CustomTooltips } from '@coreui/coreui-plugin-chartjs-custom-tooltips';
import Popup from "reactjs-popup";

import {
  Card,
  CardColumns,
  CardBody,
  CardHeader,
} from 'reactstrap';


const line = {
  labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
  datasets: [
    {
      label: 'My First dataset',
      fill: false,
      lineTension: 0.1,
      backgroundColor: 'rgba(75,192,192,0.4)',
      borderColor: 'rgba(75,192,192,1)',
      borderCapStyle: 'butt',
      borderDash: [],
      borderDashOffset: 0.0,
      borderJoinStyle: 'miter',
      pointBorderColor: 'rgba(75,192,192,1)',
      pointBackgroundColor: '#fff',
      pointBorderWidth: 1,
      pointHoverRadius: 5,
      pointHoverBackgroundColor: 'rgba(75,192,192,1)',
      pointHoverBorderColor: 'rgba(220,220,220,1)',
      pointHoverBorderWidth: 2,
      pointRadius: 1,
      pointHitRadius: 10,
      data: [65, 59, 80, 81, 56, 55, 40],
    },
  ],
};

const bar = {
  labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
  datasets: [
    {
      label: 'My First dataset',
      backgroundColor: 'rgba(255,99,132,0.2)',
      borderColor: 'rgba(255,99,132,1)',
      borderWidth: 1,
      hoverBackgroundColor: 'rgba(255,99,132,0.4)',
      hoverBorderColor: 'rgba(255,99,132,1)',
      data: [65, 59, 80, 81, 56, 55, 40],
    },
  ],
};

const doughnut = {
  labels: [
    'Red',
    'Green',
    'Yellow',
  ],
  datasets: [
    {
      data: [300, 50, 100],
      backgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
      ],
      hoverBackgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
      ],
    }],
};

const radar = {
  labels: ['Eating', 'Drinking', 'Sleeping', 'Designing', 'Coding', 'Cycling', 'Running'],
  datasets: [
    {
      label: 'My First dataset',
      backgroundColor: 'rgba(179,181,198,0.2)',
      borderColor: 'rgba(179,181,198,1)',
      pointBackgroundColor: 'rgba(179,181,198,1)',
      pointBorderColor: '#fff',
      pointHoverBackgroundColor: '#fff',
      pointHoverBorderColor: 'rgba(179,181,198,1)',
      data: [65, 59, 90, 81, 56, 55, 40],
    },
    {
      label: 'My Second dataset',
      backgroundColor: 'rgba(255,99,132,0.2)',
      borderColor: 'rgba(255,99,132,1)',
      pointBackgroundColor: 'rgba(255,99,132,1)',
      pointBorderColor: '#fff',
      pointHoverBackgroundColor: '#fff',
      pointHoverBorderColor: 'rgba(255,99,132,1)',
      data: [28, 48, 40, 19, 96, 27, 100],
    },
  ],
};

const pie = {
  labels: [
    'Red',
    'Green',
    'Yellow',
  ],
  datasets: [
    {
      data: [300, 50, 100],
      backgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
      ],
      hoverBackgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
      ],
    }],
};

const polar = {
  datasets: [
    {
      data: [
        11,
        16,
        7,
        3,
        14,
      ],
      backgroundColor: [
        '#FF6384',
        '#4BC0C0',
        '#FFCE56',
        '#E7E9ED',
        '#36A2EB',
      ],
      label: 'My dataset' // for legend
    }],
  labels: [
    'Red',
    'Green',
    'Yellow',
    'Grey',
    'Blue',
  ],
};

const options = {
  tooltips: {
    enabled: false,
    custom: CustomTooltips
  },
  maintainAspectRatio: false
}

class PersonalityInsights extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return(
      // <div className="animated fadeIn">
      //   <CardColumns className="cols-2">
      //     <Card>
      //       <CardHeader>
      //         Doughnut Chart
      //         <div className="card-header-actions">
      //           <a href="http://www.chartjs.org" className="card-header-action">
      //             <small className="text-muted">docs</small>
      //           </a>
      //         </div>
      //       </CardHeader>
      //       <CardBody>
      //         <div className="chart-wrapper">
      //           <Doughnut data={doughnut} />
      //         </div>
      //       </CardBody>
      //     </Card>
      //     <Card>
      //       <CardHeader>
      //         Radar Chart
      //         <div className="card-header-actions">
      //           <a href="http://www.chartjs.org" className="card-header-action">
      //             <small className="text-muted">docs</small>
      //           </a>
      //         </div>
      //       </CardHeader>
      //       <CardBody>
      //         <div className="chart-wrapper">
      //           <Radar data={radar} />
      //         </div>
      //       </CardBody>
      //     </Card>
      //     <Card>
      //       <CardHeader>
      //         Pie Chart
      //         <div className="card-header-actions">
      //           <a href="http://www.chartjs.org" className="card-header-action">
      //             <small className="text-muted">docs</small>
      //           </a>
      //         </div>
      //       </CardHeader>
      //       <CardBody>
      //         <div className="chart-wrapper">
      //           <Pie data={pie} />
      //         </div>
      //       </CardBody>
      //     </Card>
      //     <Card>
      //       <CardHeader>
      //         Polar Area Chart
      //         <div className="card-header-actions">
      //           <a href="http://www.chartjs.org" className="card-header-action">
      //             <small className="text-muted">docs</small>
      //           </a>
      //         </div>
      //       </CardHeader>
      //       <CardBody>
      //         <div className="chart-wrapper">
      //           <Polar data={polar} options={options}/>
      //         </div>
      //       </CardBody>
      //     </Card>
      //   </CardColumns>
      // </div>
        <div className="animated fadeIn">
        <Card>
        <CardHeader>
          <strong>Novo Candidato</strong>
        </CardHeader>
        <CardBody>
        <Row>
          <Col xs="12" md="6">
            <Card>
              <CardHeader>
                <strong><i className="cui-user-follow"></i>&nbsp;Informações Pessoais</strong>
              </CardHeader>
              <CardBody>
                <Form action="" method="post" encType="multipart/form-data" className="form-horizontal">
                  <FormGroup row>
                      <Col md="3">
                        <Label htmlFor="nome">Nome</Label>
                      </Col>
                      <Col xs="12" md="9">
                        <Input 
                          type="text" 
                          id="nome" 
                          name="nome" 
                          onChange={this.handleChange} 
                          value={this.state.nome} 
                          invalid={this.state.invalid.nome} 
                          valid={this.state.valid.nome} 
                          required
                          />
                          <FormFeedback invalid="">Insira o nome do candidato</FormFeedback>
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="3">
                        <Label htmlFor="text-input">Sobrenome</Label>
                      </Col>
                      <Col xs="12" md="9">
                        <Input 
                          type="text" 
                          id="sobrenome" 
                          name="sobrenome" 
                          onChange={this.handleChange} 
                          value={this.state.sobrenome} 
                          invalid={this.state.invalid.sobrenome} 
                          valid={this.state.valid.sobrenome} 
                          required
                        />
                        <FormFeedback invalid="">Insira o Sobrenome do candidato</FormFeedback>
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                    <Col md="3">
                      <Label htmlFor="email-input">Email</Label>
                    </Col>
                    <Col xs="12" md="9">
                      <Input 
                      type="email" 
                      id="email" 
                      name="email" 
                      autoComplete="email" 
                      onChange={this.handleChange} 
                      value={this.state.email} 
                      invalid={this.state.invalid.email} 
                      valid={this.state.valid.email}
                      required
                      />
                      <FormFeedback invalid="">Insira um e-mail válido</FormFeedback>
                    </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="3">
                        <Label htmlFor="text-input">CPF</Label>
                      </Col>
                      <Col xs="12" md="9">
                        <Input 
                          type="text"  
                          id="cpf" 
                          name="cpf" 
                          onChange={this.handleChange} 
                          value={this.state.cpf} 
                          invalid={this.state.invalid.cpf} 
                          valid={this.state.valid.cpf}
                          required
                        />
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                    <Col md="3">
                      <Label htmlFor="date-input">Data de Nascimento</Label>
                    </Col>
                    <Col xs="12" md="9">
                      <Input 
                        type="date" 
                        id="data_nascimento" 
                        name="data_nascimento" 
                        placeholder="date" 
                        onChange={this.handleChange} 
                        value={this.state.data_nascimento} 
                        invalid={this.state.invalid.data_nascimento} 
                        valid={this.state.valid.data_nascimento}
                        required
                      />
                    </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="3">
                        <Label htmlFor="text-input">Telefone</Label>
                      </Col>
                      <Col xs="12" md="9">
                        <Input 
                          type="text" 
                          id="telefone" 
                          name="telefone" 
                          onChange={this.handleChange} 
                          value={this.state.telefone}
                          invalid={this.state.invalid.telefone} 
                          valid={this.state.valid.telefone}
                          required
                          />
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="3">
                        <Label htmlFor="text-input">Celular</Label>
                      </Col>
                      <Col xs="12" md="9">
                        <Input 
                        type="text" 
                        id="celular" 
                        name="celular" 
                        onChange={this.handleChange} 
                        value={this.state.celular} 
                        invalid={this.state.invalid.celular} 
                        valid={this.state.valid.celular}
                        required
                        />
                      </Col>
                    </FormGroup>
                  <FormGroup row>
                    <Col md="3">
                      <Label htmlFor="file-input">Curriculo</Label>
                    </Col>
                    <Col xs="12" md="9">
                      <Input
                      type="file" 
                      id="file-input" 
                      name="file-input" 
                      onChange={this.handleChangeFile} 
                      />
                    </Col>
                  </FormGroup>
                </Form>
              </CardBody>
            </Card>
          </Col>
          <Col xs="12" md="6">
            <Card>
              <CardHeader>
                <strong><i className="cui-location-pin"></i>&nbsp;Endereço</strong>
              </CardHeader>
              <CardBody>
                <Form action="" method="post" encType="multipart/form-data" className="form-horizontal">
                  <FormGroup row>
                      <Col md="2">
                        <Label htmlFor="text-input">CEP</Label>
                      </Col>
                      <Col xs="12" md="4">
                      <InputGroup>
                        <Input 
                          type="text" 
                          id="cep" 
                          name="cep" 
                          placeholder="CEP" 
                          onChange={this.handleChange} 
                          value={this.state.cep} 
                          maxLength="8" 
                          invalid={this.state.invalid.cep} 
                          valid={this.state.valid.cep}
                          required
                          />
                        <InputGroupAddon addonType="append">
                          <Button type="button" color="success" onClick={this.validateCEP}>Validar</Button>
                        </InputGroupAddon>
                        <FormFeedback invalid="">Insira um CEP válido</FormFeedback>
                      </InputGroup>
                      </Col>
                      <Col md="2">
                        <Label htmlFor="text-input">Número</Label>
                      </Col>
                      <Col xs="12" md="4">
                        <Input 
                          type="text" 
                          id="endereco_numero" 
                          name="endereco_numero" 
                          onChange={this.handleChange} 
                          value={this.state.endereco_numero} 
                          invalid={this.state.invalid.endereco_numero} 
                          valid={this.state.valid.endereco_numero}
                          required
                        />
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                    <Col md="2">
                      <Label htmlFor="text-input">Complemento</Label>
                    </Col>
                    <Col xs="12" md="10">
                      <Input type="text" id="complemento" name="complemento" value={this.state.complemento} onChange={this.handleChange}/>
                    </Col>
                    </FormGroup>
                    <FormGroup row>
                    <Col md="2">
                      <Label htmlFor="text-input">Logradouro</Label>
                    </Col>
                    <Col xs="12" md="10">
                      <Input type="text" id="logradouro" name="logradouro" value={this.state.logradouro} readOnly/>
                    </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="2">
                        <Label htmlFor="text-input">Bairro</Label>
                      </Col>
                      <Col xs="12" md="10">
                        <Input type="text" id="bairro" name="bairro" value={this.state.bairro} readOnly/>
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="2">
                        <Label htmlFor="text-input">Cidade</Label>
                      </Col>
                      <Col xs="12" md="10">
                        <Input type="text" id="localidade" name="localidade" value={this.state.localidade} readOnly/>
                      </Col>
                    </FormGroup>
                    <FormGroup row>
                      <Col md="2">
                        <Label htmlFor="text-input">UF</Label>
                      </Col>
                      <Col xs="12" md="10">
                        <Input type="text" id="uf" name="text-input" value={this.state.uf} readOnly/>
                      </Col>
                    </FormGroup>
                </Form>
              </CardBody>
            </Card>
          </Col>
        </Row>
        </CardBody>
        <CardFooter>
              <Popup open={this.state.popup.open} closeOnDocumentClick onClose={this.closePopup}>
              <Card className="text-white bg-primary py-5 d-md-down-none" style={{ width: '100%' }}>
                  <CardBody className="text-center">
                    <div>
                      <h2>{this.state.popup.message}</h2>
                      <p>Voltar para o menu?</p>
                      <Link to="/dashboard">
                        <Button color="primary" className="mt-3" active tabIndex={-1}>Menu</Button>
                      </Link>
                    </div>
                  </CardBody>
                </Card>
              </Popup>
                <Button type="submit" size="sm" color="success" onClick={this.registerUser}><i className="fa fa-dot-circle-o"></i> Enviar</Button>
                &nbsp;
                <Button type="reset" id="reset" size="sm" color="danger" onClick={this.clearFields}><i className="fa fa-ban" ></i> Limpar</Button>
                &nbsp;
                {this.renderMessage()}
        </CardFooter> 
        </Card>
      </div>
  );
  }
}
export default PersonalityInsights;
